import Login from'./login.js';
import AuthCode from './AuthCode.jsx'
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';

function App() {
  return (
    <div>
      <Login type="login" />
    <Router>
      <div>
        <Switch>
          <Route path="/authcode" component={AuthCode}/>
        </Switch>
      </div>
    </Router>
    </div>

  );
}



export default App;
